import "./M_P.css";
import { useLocation } from "react-router-dom";
import { PageTemplate, TopMenu } from "./Menus";

function Schedule() {
  const location = useLocation();
  const type = location.state;
  const c = () => {
    console.log(location);
    console.log(type.using_id);
  };
  return (
    <PageTemplate>
      <section className="schedule">
        <TopMenu />
        <h1>[Schedule]</h1>
        <p>This area is for schedule</p>
      </section>
    </PageTemplate>
  );
}

export default Schedule;
